const base =
  "data:image/png;base64,";

const runWasm = async () => {
  const size = 512 * 512;
  const byteSize = size * 4;

  const memory = new WebAssembly.Memory({
    initial: (((byteSize + 0xffff) & ~0xffff) >>> 16) * 3,
  });

  const response = await WebAssembly.instantiateStreaming(
    fetch("./build/release.wasm"),
    {
      env: {
        seed: Date.now,
        memory,
      },
    },
  );
  const exports = response.instance.exports;

  const canvas = document.getElementById("canvas");
  const context = canvas.getContext("2d");

  const image = new Image();
  image.onload = () => {
    context.fillStyle = "black";
    context.fillRect(0, 0, 512, 512);
    context.drawImage(image, 128, 128);
    let imageData = context.getImageData(0, 0, 512, 512);

    const buffer = new Uint8ClampedArray(memory.buffer);
    for (let i = 0; i < imageData.data.length; i++) {
      buffer[i] = imageData.data[i];
    }
    const argb = new Uint8ClampedArray(imageData.data.buffer);

    console.log(buffer);

    // (function update() {
    //   setTimeout(update, 1000 / 30);
    //   buffer.copyWithin(0, byteSize, byteSize * 2);
    //   exports.update();
    // })();

    (function render() {
      requestAnimationFrame(render);
      exports.update();
      argb.set(buffer.subarray(byteSize, byteSize * 2));
      context.putImageData(imageData, 0, 0);
      buffer.copyWithin(0, byteSize, byteSize * 2);
    })();
  };
  image.src = base;
};
runWasm();
